import React from 'react';
import '../App.css';

function Projects() {
    const [techno, setTechno] = useState("React");

    return (<div>

                <ul class="pagination center">
                    <li onclick={() => setTechno("React")} class="active teal">&nbsp;&nbsp;&nbsp;React&nbsp;&nbsp;&nbsp;</li>
                    <li onclick={() => setTechno("Angular")} class="waves-effect">&nbsp;&nbsp;&nbsp;Angular&nbsp;&nbsp;&nbsp;</li>
                    <li onclick={() => setTechno("JAVA")} class="waves-effect">&nbsp;&nbsp;&nbsp;JAVA&nbsp;&nbsp;&nbsp;</li>
                    <li onclick={() => setTechno("Python")} class="waves-effect">&nbsp;&nbsp;&nbsp;Python&nbsp;&nbsp;&nbsp;</li>
                    <li onclick={() => setTechno("C")} class="waves-effect">&nbsp;&nbsp;&nbsp;C&nbsp;&nbsp;&nbsp;</li>
                </ul>

            </div> );
}

export default Projects;
